What does “find yourself outside” mean to you? And how could you share your answer visually through art? These are the questions @eddiebauer recently asked of Black artists @thecurlynugget and @thekingfroshow in their creation of a thought-provoking mural situated in Seattle’s Central District. In this video, we get to hear from @urbanartworks' Projects Lead Paul Nunn about the artists’ approach to the mural, the partnership with Eddie Bauer, and the environmental setting of the piece. All in all, the mural is a beautiful visual representation that is truly an experience to witness, especially in person! The mural can be viewed and enjoyed from Flo Ware Park, named after and in honor of the Black community activist in the Leschi community.
Mural artwork by @thecurlynugget and @thekingfroshow, please visit their pages and support their incredible work!
